import React from "react";
import styled from "styled-components";
const Line = () => {
    
    let Line = styled.div`
        height: inherit;
        align-items: center;
        border-left: solid black 3px;
        position: absolute;
        z-index: 1;
    `
    return (
        <Line />
    )
}

export default Line;
